package java4;

import java.util.HashSet;

public class setrun {

	



	public static void main(String[] args) {
		// TODO Auto-generated method stub
HashSet hs = new HashSet();

hs.add(10);// does not allow the duplicates
hs.add(20);
hs.add(30);
hs.add(40);
		System.out.println(hs);
		
		//for read
		for(Object y5: hs);
		System.out.println(y5);
		//like we have many inbuild method in java
		
		
	}

}
